import React from 'react';
import PropTypes from 'prop-types';
import clsx from 'clsx';
import { withStyles } from '@material-ui/styles';
import {
    Card,
    CardHeader,
    CardContent,
    CardActions,
    Typography,
    Grid,
    Divider,
    Avatar
} from '@material-ui/core';
import { StatusBullet } from 'components';
import { URI } from './../../../../constants/types';
import styles from './styles';

const statusColors = {
    true: 'success',
    false: 'danger'
};

const PresencesCard = props => {
    const { className, classes } = props;
    return (
        <Card className={clsx(classes.root, className)}>
            <Grid container>
                <Grid item lg={4} md={4} xs={12}>
                    <CardHeader
                        avatar={
                            <Avatar
                                src={
                                    'http://www.gravatar.com/avatar/f8aef9003205946523250a062b54bbb6?s=200&r=pg&d=retro'
                                }
                            />
                        }
                        title={
                            <Typography variant="h5">
                                Mella Full Screen Slider
                            </Typography>
                        }
                        subheader={
                            <Typography variant="body2">by She Fen</Typography>
                        }
                    />
                </Grid>
                <Grid item lg={8} xs style={{border: '1px solid green'}}>
                    <CardContent>
                        <Grid
                            container

                            //justify="flex-start"
                            //alignItems="center"
                            //spacing={2}
                        >
                            <Grid item xs style={{border: '1px solid red'}}>
                                <Grid container direction="row" spacing={2} alignItems="center">
                                    <Grid item>
                                        <Typography variant="h5">2 day mini</Typography>
                                        <Typography variant="body1">
                                            End time
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="h5">12</Typography>
                                        <Typography variant="body1">
                                            Total member
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="h5">12 November 2019</Typography>
                                        <Typography variant="body1">
                                            Start time
                                        </Typography>
                                    </Grid>
                                </Grid>
                            </Grid>
                            <Grid item xs style={{border: '1px solid blue'}}>
                                <Grid container direction="row" spacing={2} alignItems="center">
                                    <Grid item>
                                        <Typography variant="h5">12 November 2019</Typography>
                                        <Typography variant="body1">
                                            End time
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="h5">Active</Typography>
                                        <Typography variant="body1">
                                            status
                                        </Typography>
                                    </Grid>
                                    <Grid item>
                                        <Typography variant="body1">
                                            View
                                        </Typography>
                                    </Grid>
                                </Grid>
                            </Grid>
                        </Grid>
                    </CardContent>
                </Grid>
            </Grid>
        </Card>
    );
};
export default withStyles(styles)(PresencesCard);
